id = "PAV233"
question = "Varför rekommenderas det inte att minimera de språkliga kraven i matematikuppgifter för elever med läs- och skrivsvårigheter?"
answer = "Välmenta försök från lärares sida att låta eleverna undvika läs- och skrivsvårigheter genom att låta dem arbeta med uppgifter där de språkliga kraven är minimerade rekommenderas inte (El Naggar, 1996)"
